window.bookSummaryJSON = "<p>During the pandemic, our homes and apartments have transported us to new places, different experiences, and changed our understanding of ourselves and others. This collection of 12 tales explores those journeys through the lens of fantasy and science fiction, accentuating the strange and unexpected to reveal the relatable, human dimensions of our continuing migration from whatâ€™s normal to a new normal...or even paranormal.</p> <p>Jonathan Salem Baskin wrote <i>Strange in Place</i> because unusual times call for unusual stories.&nbsp;</p>"; 
